'use strict';

var React = require("react");
var DomUtils = require("../shared/utils/DomUtils.bs.js");
var ReactDOMRe = require("reason-react/src/ReactDOMRe.js");
var Json_decode = require("@glennsl/bs-json/src/Json_decode.bs.js");
var StudentsEditor__Root = require("../schools/courses/components/StudentsEditor__Root.bs.js");
var StudentsEditor__Coach = require("../schools/courses/types/students_editor/StudentsEditor__Coach.bs.js");
var StudentsEditor__Level = require("../schools/courses/types/students_editor/StudentsEditor__Level.bs.js");

function decodeProps(json) {
  return {
          courseId: Json_decode.field("courseId", Json_decode.string, json),
          courseCoachIds: Json_decode.field("courseCoachIds", (function (param) {
                  return Json_decode.array(Json_decode.string, param);
                }), json),
          schoolCoaches: Json_decode.field("schoolCoaches", (function (param) {
                  return Json_decode.array(StudentsEditor__Coach.decode, param);
                }), json),
          levels: Json_decode.field("levels", (function (param) {
                  return Json_decode.array(StudentsEditor__Level.decode, param);
                }), json),
          studentTags: Json_decode.field("studentTags", (function (param) {
                  return Json_decode.array(Json_decode.string, param);
                }), json)
        };
}

var props = decodeProps(DomUtils.parseJSONTag("sa-students-panel-data", /* () */0));

ReactDOMRe.renderToElementWithId(React.createElement(StudentsEditor__Root.make, {
          courseId: props.courseId,
          courseCoachIds: props.courseCoachIds,
          schoolCoaches: props.schoolCoaches,
          levels: props.levels,
          studentTags: props.studentTags
        }), "sa-students-panel");

exports.decodeProps = decodeProps;
exports.props = props;
